const organize_day = (storage, day) => {
  let returned_value = [];
  let site_stats = storage["site-stats"];
  let all_sites = Object.keys(site_stats);

  // 24 hours in a day
  for (let i = 0; i < 24; i++) {
    let d1 = day
    let d2 = day
    let returned = [];
    all_sites.map((site) => {
      returned.push({
        website: site,
        time: time_array(
          site_stats[site],
          new Date(setToHour(d1, i)),
          new Date(setToHour(d2, i + 1))
        ),
      });
    });
    returned_value.push(returned)
  }
  return returned_value
};

